script: |
  super -f tsv -I q9549.sql | sort > q9549.out

vector: true

inputs:
  - name: q9549.sql
    data: |
      SELECT ALL + MIN ( ( - col2 ) ) AS col0 FROM tab0 WHERE + + col0 * - - col0 + col2 NOT IN ( - ( + ( - ( + col0 ) ) ) * + 87 + - col2 );
  - name: tab0

outputs:
  - name: q9549.out
    data: |
      -99
